    enter_count = 1
    exit_count = 0

    def acquire_resource():
        nonlocal enter_count
        enter_count += 1

    def release_resource(exc_type, exc_val, exc_tb):
        nonlocal exit_count
        exit_count += 1
        if custom_callback is not None:
            custom_callback(enter_count, exit_count)
        return False
    return (acquire_resource, release_resource)

